            int s = stack1[--top];
            String startTag = stack2[top];
            int e = includeTag ? m.end() : m.start();
            if (features == null || startTag.indexOf(features) != -1) ret.add(source.substring(s, e));
        } else {
            stack1[top] = includeTag ? m.start() : m.end();
            stack2[top++] = g;
        }
    }
    return ret.toArray(new String[0]);
