        case SOCPossiblePiece.ROAD:
            targetResources = SOCGame.ROAD_SET;
            break;
        case SOCPossiblePiece.SETTLEMENT:
            targetResources = SOCGame.SETTLEMENT_SET;
            break;
        case SOCPossiblePiece.CITY:
