                as.calcScoreMatrix();
                as.traceAlignment();
                as.printAlignment();
                distance[i][j] = (float) as.maxscore;
                if (max < distance[i][j]) {
                    max = distance[i][j];
                }
            }
        }
        for (int i = 0; i < noseqs - 1; i++) {
            for (int j = i; j < noseqs; j++) {
                distance[i][j] = max - distance[i][j];
                distance[j][i] = distance[i][j];
            }
        }
    }
    return distance;
