        }
        if (hashCnt > 0) {
            if (hashCnt > olCnt) {
                while (hashCnt > olCnt) {
                    buff.append("<ol>\n");
                    olCnt++;
                }
            } else {
                while ((hashCnt < olCnt) && (olCnt > 0)) {
