        j = matcher.start(2);
        k = matcher.end(2);
        strb.append(text, i, j - 1);
        renderTextInlinedElement(strb, text, j, k);
        i = k + 1;
    }
    if (i < text.length()) {
        strb.append(text, i, end);
    }
